import React, { Component } from "react";
import Link from "next/link";
// https://jsonplaceholder.typicode.com/posts
export default class Index extends Component {
  getInitialProps() {}

  render() {
    return (
      <div>
        <h1>Index Page</h1>
        <Link href="/about">
          <a>About</a>
        </Link>
        <br></br>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </div>
    );
  }
}

